import './ExpenseItem.css'
function ExpenseItem(){ 
    const expenseDate = new Date(2021,2,28); 
    const expenseTitle = 'Car Insurance'; 
    const expenseAmount = 239.85; 

    return  (<div>
                <div className='expense-item'>{expenseDate}</div>
                <div className='expense-item__description'><h2 className='expense-item__description'>{expenseTitle}</h2>
                <div className='expense_item__price'>{expenseAmount}</div>
                </div>
    </div>);
}

export default ExpenseItem;
